import React from "react";

const GuessPopup = ({ currChosen, currTrack }) => {
  let correct = false;
  if (currChosen === currTrack.country) correct = true;

  return (
    <div className="container">
      <div className="guess-popup">
        <div>
          <h1>Good job!</h1>
          <h3>You correctly guessed {currChosen}</h3>
          <h3>Score: 372 (+100)</h3>
        </div>
        <div>
          <img
            src={currTrack.image}
            alt="Album image"
            width="300"
            height="300"
          ></img>
          <div className="textDiv"></div>
          <span>Artist: {currTrack.artist}</span>
          <span>Country: {currTrack.country}</span>
        </div>
      </div>
    </div>
  );
};

export default GuessPopup;
